import Home from "../pages/Home";

// Declarando as rotas para renderizar os item de acordo com a rota
const routesHeader = [
  {
    name: "Home",
    path: "/",
    component: <Home />,
  },
  {
    name: "News",
    path: "/news",
  },
  {
    name: "Settings",
    path: "/settings",
  },
];

const routesSidebar = [
  {
    name: "My Account",
    path: "/account",
  },
  {
    name: "All Games",
    path: "/",
  },
  {
    name: "My Library",
    path: "/library",
  },
];

const routes = [...routesHeader, ...routesSidebar];
export { routesHeader, routesSidebar, routes };
